import React from "react";

function Bookcomp(props){
    return (
        <div>
        <tr key = {props.id}>
            <td>
                {props.bookName}
            </td>
                        <td>
                {props.cost}
            </td>

        </tr>


        </div>
    );
}
export default Bookcomp;
